g2:c.PROCEDURE.g2:a.TEXT:
nol-example-launch-localized-file-dialog (Settings: class g2ui-file-dialog-settings, Path: text, Window: class g2-window) = (text, text)
{GroupResource: class gfr-text-resource-group = example-open-file-text-resources;}
Txt, Directory, Filename: text;
Type: symbol;
Version: float = 4.0;
Revision: integer = 2;
begin
   { if (the dialog-text-updated-from of settings = the symbol object-settings) then begin
        version, revision = call gfr-get-g2-version ();
        txt = call gfr-localize-message (GroupResource, the symbol k-directories-eb-label, gfr-language (window), version, revision, window);
        conclude that the directory-edit-box-label of settings = txt;
        txt = call gfr-localize-message (GroupResource, the symbol k-filename-eb-label, gfr-language (window), version, revision, window);
        conclude that the file-name-edit-box-label of settings = txt;
        txt = call gfr-localize-message (GroupResource, the symbol k-open-file-dialog-title, gfr-language (window), version, revision, window);
        conclude that the dialog-title of settings = txt;
        txt = call gfr-localize-message (GroupResource, the symbol k-ok, gfr-language (window), version, revision, window);
        conclude that the ok-button-label of settings = txt;
        txt = call gfr-localize-message (GroupResource, the symbol k-apply, gfr-language (window), version, revision, window);
        conclude that the apply-button-label of settings = txt;
        txt = call gfr-localize-message (GroupResource, the symbol k-cancel, gfr-language (window), version, revision, window);
        conclude that the cancel-button-label of settings = txt;
    end;}
    type = call g2-type-of-file-system ();
    if (type = the symbol win32) then filename, directory = call g2ui-file-launch-dialog ("g2ui-file-pc-dialog", window, settings)
    else begin
        conclude that the default-directory-for-unix of Settings = Path;
        Filename, Directory = call g2ui-file-launch-dialog ("g2ui-file-dialog", Window, Settings);
    end;
    return Directory, Filename;
end

_nol-browse-files (Dlg: class uil-dialog, Butt: class uil-button, Win: class object, Blk: class nol-block, Actions: class symbol-list) 
Path, File: text; 
EN: symbol; ET: text; 
file-exists-p: truth-value; 
stream: class g2-stream;
EB: class uil-edit-box;
N_A: item-or-value = the symbol no-item;
begin
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("pathname-ebox", Dlg);
    Path = call uil-get-edit-box-value (Dlg, "pathname-ebox");
    {conclude that the file-pathname of Blk = Path;}
    file-exists-p = call g2-file-exists(Path);
    if file-exists-p then begin
        
    end;
    Path, File = call nol-example-launch-localized-file-dialog (_nol-browse-file-settings, Path, Win);
    call uil-update-text (EB, "[Path][File]");
end
